import React, { useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom'; // üëà ÌéòÏù¥ÏßÄ Ïù¥ÎèôÏùÑ ÏúÑÌï¥ Ï∂îÍ∞Ä
import { GoogleLogin } from '@react-oauth/google';
import './css/login.css';

function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate(); // üëà ÌéòÏù¥ÏßÄ Ïù¥Îèô Ìï®Ïàò

  const handleGoogleSignup = async (credentialResponse) => {
    try {
        const res = await axios.post('http://localhost:8080/users/googleLogin', {
            token: credentialResponse.credential,
        },
        {
          headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
          withCredentials: true,
        }
      );

        const userId = res.data.user_id;

        if (!userId) {
            alert("ÏÑúÎ≤ÑÎ°úÎ∂ÄÌÑ∞ ÏÇ¨Ïö©Ïûê IDÎ•º Î∞õÏßÄ Î™ªÌñàÏäµÎãàÎã§.");
            return;
        }

        localStorage.setItem("user_id", userId);
        alert("Íµ¨Í∏Ä ÌöåÏõêÍ∞ÄÏûÖ ÏÑ±Í≥µ!");
        navigate('/user-details');
    } catch (err) {
        console.error(err);
        alert("Íµ¨Í∏Ä ÌöåÏõêÍ∞ÄÏûÖ Ïã§Ìå®");
    }
  };

  const handleLogin = async (e) => {
    e.preventDefault();
  
    try {
      const response = await axios.post(
        'http://localhost:8080/users/loginUser', 
        new URLSearchParams({
          email: username,
          user_password: password,
        }),
        {
          headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
          withCredentials: true,
        }
      );

      if (response.status === 200) {
        alert('Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ!');
        console.log(response.data); // üëà Ïú†Ï†Ä Ï†ïÎ≥¥ ÌôïÏù∏

        // Ïú†Ï†Ä Ï†ïÎ≥¥ Ï†ÄÏû• (Ïòà: localStorage)
        localStorage.setItem('user', JSON.stringify(response.data));

        // ÌéòÏù¥ÏßÄ Ïù¥Îèô
        navigate('/');
      }
    } catch (err) {
      setError('Î°úÍ∑∏Ïù∏ Ïã§Ìå®: ÏïÑÏù¥Îîî ÎòêÎäî ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÌôïÏù∏ÌïòÏÑ∏Ïöî.');
      console.error(err);
    }
  };

  return (
    <div className="container">
      <div className="text-center">
          <h1>Îã§Ïãú Ïò§Ïã† Í±∏ ÌôòÏòÅÌï©ÎãàÎã§</h1>
      </div>
      <form onSubmit={handleLogin}>
          <div className="form-group">
              <input 
                  type="text"
                  className="form-control" 
                  placeholder="Ïù¥Î©îÏùº*" 
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required 
              />
          </div>
          <div className="form-group">
              <input 
                  type="password" 
                  className="form-control" 
                  placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏*" 
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required 
              />
          </div>
          {error && <div className="error-message">{error}</div>}
          <button type="submit" className="btn btn-primary">Í≥ÑÏÜç</button>
          
          <div className="find-account-links">
              <Link to="/findaccount" className="small">Ïù¥Î©îÏùº Ï∞æÍ∏∞ | ÎπÑÎ∞ÄÎ≤àÌò∏ Ï∞æÍ∏∞</Link>
          </div>
          
          <div className="divider">ÎòêÎäî</div>
          
          <GoogleLogin
            onSuccess={(credentialResponse) => {
              console.log('Íµ¨Í∏Ä Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ', credentialResponse);
              handleGoogleSignup(credentialResponse); // ‚úÖ Ïù¥ Ï§ÑÏùÑ Ï∂îÍ∞Ä
            }}
            onError={() => {
              console.log('Íµ¨Í∏Ä Î°úÍ∑∏Ïù∏ Ïã§Ìå®');
            }}
          />
          <a href="#" className="btn btn-google">
              <svg width="18" height="18" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M12 2C6.48 2 2 6.48 2 12C2 17.52 6.48 22 12 22C17.52 22 22 17.52 22 12C22 6.48 17.52 2 12 2ZM12 5C13.66 5 15 6.34 15 8C15 9.66 13.66 11 12 11C10.34 11 9 9.66 9 8C9 6.34 10.34 5 12 5ZM12 19.2C9.5 19.2 7.29 17.92 6 15.98C6.03 13.99 10 12.9 12 12.9C13.99 12.9 17.97 13.99 18 15.98C16.71 17.92 14.5 19.2 12 19.2Z" 
                  fill="#202123"/>
              </svg>
              Ìè∞ÏúºÎ°ú Í≥ÑÏÜçÌïòÍ∏∞
          </a>
      </form>
      <div className="text-center footer-links">
          <Link to="/terms" className="small">Ïù¥Ïö©ÏïΩÍ¥Ä</Link>
          <span className="divider-vertical">|</span>
          <Link to="/privacy" className="small">Í∞úÏù∏Ï†ïÎ≥¥ Î≥¥Ìò∏ Ï†ïÏ±Ö</Link>
      </div>
    </div>
  );
}

export default Login;
